import React from 'react';
import {PriceCardDisplayV} from './src/PriceCardWidget';

const ServicesData=[ {name:"Access to basic tutorials",id:1},
{name:"Basic resources",id:2},
{name:"Basic community access",id:3},
{name:"eBooks",id:4},
{name:"Podcats",id:5},
{name:"Access to souces files",id:6},
{name:"Live chat",id:7},];


const cardData=[
{
  planName:"free",
  amount:"$28 /month",
  bg:'yellow'
},
{
  planName:"Standard",
  amount:"$35 /month",
  bg:'orange'
},
{
  planName:"Premium",
  amount:"$42 /month",
  bg:'green'
}
];

const background={
  bg1:{ backgroundColor:'black'},
  bg2:{ backgroundColor:'black'},
  bg3:{ backgroundColor:'black'}
}


const ContentHeaderStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'900',
  color:'orange',
  fontSize:'80px',
  marginTop:'5px',
}

const ContentTitleStyles={
  display:'flex',
  fontWeight:'800',
  color:'black',
  textTransform: 'uppercase',
  fontSize:'20px',
  marginTop:'10px',
}

const ContentIconStyles={
  width:'100px',
  height:'100px'
}

const ContentDescriptionStyles={
  display:'flex',
  fontWeight:'300',
  fontSize:'20px',
  marginTop:'10px',
}


function App() {
  return (
    <div>
     <PriceCardDisplayV
     cardData={cardData}
     ServicesData={ServicesData}
     ContentHeaderStyles={ContentHeaderStyles}
     ContentTitleStyles={ContentTitleStyles}
     ContentIconStyles={ContentIconStyles}
     ContentDescriptionStyles={ContentDescriptionStyles}
     />
    </div>
  );
}

export default App;
